tables.table_schema:
CREATE TABLE WinePrices (
    id INT PRIMARY KEY,
    wine_name VARCHAR(50),
    vintage_year INT,
    price DECIMAL(10,2)
);

CREATE TABLE WineTasters (
    taster_id INT PRIMARY KEY,
    taster_name VARCHAR(50),
    taster_type VARCHAR(50),
    country_of_origin VARCHAR(50)
);

CREATE TABLE wine_tasters (
  taster_id UUID PRIMARY KEY,
  taster_name VARCHAR(255),
  location VARCHAR(100)
);

CREATE TABLE wine_tasters ( 
   taster_id INT PRIMARY KEY, 
   taster_name VARCHAR(255), 
   taster_location VARCHAR(100), 
   rating DECIMAL 
 );

CREATE TABLE vineyards ( 
   vineyard_id INT PRIMARY KEY, 
   vineyard_name VARCHAR(255), 
   region VARCHAR(100), 
   established_year INT 
 );

CREATE TABLE grape_varieties ( 
   variety_id INT PRIMARY KEY, 
   variety_name VARCHAR(255), 
   color VARCHAR(50), 
   origin_country VARCHAR(100) 
 );

CREATE TABLE wine_producers ( 
   producer_id INT PRIMARY KEY, 
   producer_name VARCHAR(255), 
   region VARCHAR(100), 
   established_year INT 
 );
